import React, {Component} from 'react';

class NewDose extends Component {
    render() {
        return(<div className="new-dose">
        <input type="text" className="amount" placeholder="Magn" onChange={() => {}} />
        <div className="time-picker" data-time="00:00">
            <div className="hour">
                <div className="hr-up" onClick={() => {this.props.hr_up(this.props.id)}} />
                <input type="text" ref={(ref) => this.hour_input = ref} className="hr" onChange={this.props.hourEdited.bind(this, this.props.id)} value={this.props.dose.hour} max="99" />
                <div className="hr-down" onClick={() => {this.props.hr_down(this.props.id)}} />
            </div>
            <div className="separator">:</div>
            <div className="minute">
                <div className="min-up" onClick={() => {this.props.min_up(this.props.id)}}/>
                <input type="text" ref={(ref) => this.minute_input = ref} className="min" onChange={this.props.minuteEdited.bind(this, this.props.id)} value={this.props.dose.minute} max="99" />
                <div className="min-down" onClick={() => {this.props.min_down(this.props.id)}} />
            </div>
        </div>
    </div>);
    }
}

export default NewDose;
